import React, { useState, useEffect } from "react";
import axios from "axios";

const Home = (apiKey) => {
  const [topStocks, setTopStocks] = useState([]);

  useEffect(() => {
    const fetchTopStocks = async () => {
      try {
        // Replace 'MSFT' with the symbol of the stock you want to get data for
        const symbol = 'MSFT';
        const response = await axios.get(
          `https://www.alphavantage.co/query?function=TIME_SERIES_INTRADAY&symbol=${symbol}&interval=5min&apikey=${apiKey}`
        );

        // Process the response to extract the top stocks data
        const topStocksData = response.data; // Adjust this based on the actual response structure

        setTopStocks(topStocksData);
      } catch (error) {
        console.error("Error fetching top stocks data:", error);
      }
    };

    fetchTopStocks();
  }, [apiKey]);

  return (
    <div className="homeContainer">
      <div className="homeTopContainer">
        <div className="homeTitle"> Welcome to StockTracker </div>
      </div>
      <div className="homeContentContainer">
        <div className="top5Title">
          Here are the top 5 rising stocks for today!
        </div>
        <ul>
        {topStocks.map((stock, index) => (
          <li key={index}>{stock.symbol}</li>
        ))}
      </ul>
      </div>
    </div>
  );
};

export default Home;
